// ?? Left and Right Rotation By 1 Element

function leftRotate(arr = []) {
  for (let i = 0; i < arr.length - 1; i++) {
    let Item = arr[i];
    arr[i] = arr[i + 1];
    arr[i + 1] = Item;
  }
  return arr;
}
function rightRotate(arr = []) {
  for (let i = arr.length - 1; i > 0; i--) {
    let Item = arr[i - 1];
    arr[i - 1] = arr[i];
    arr[i] = Item;
  }
  return arr;
}

function leftRotateEfficient(arr = [], k = 0) {
  let rotated = [];
  for (let i = 0; i <= arr.length - 1; i++) {
    rotated[i] = arr[(i + k) % arr.length];
  }
  return rotated;
}
function rightRotateEfficient(arr = [], k = 0) {
  let rotated = [];
  for (let i = arr.length - 1; i >= 0; i--) {
    rotated[(i + k) % arr.length] = arr[i];
  }
  return rotated;
}

function ReverseArray(arr = [],i,j) {
    while(i < j) {
        let item = arr[i]
        arr[i] = arr[j]
        arr[j] = item
        i++
        j--
    }
    return arr;
}

function leftRotateReversed(arr = [], k) {
    let rotated = [...arr]
    rotated = ReverseArray(rotated,0,k-1)
    rotated = ReverseArray(rotated,k,arr.length - 1)
    rotated = ReverseArray(rotated,0,arr.length - 1)
    return rotated;
}
function rightRotateReversed(arr = [], k) {
    let rotated = [...arr]
    rotated = ReverseArray(rotated,0,arr.length - 1)
    rotated = ReverseArray(rotated,0,k-1)
    rotated = ReverseArray(rotated,k,arr.length - 1)
    return rotated;
}

