// ?? Removing Duplicate Numbers From A Sorted Array

function RemvoeDuplicates(arr = []){
    let i = 0;
    let j = 1;
    while(i < arr.length - 1) {
        if(arr[i] !== arr[i+1]) {
            arr[j] = arr[i+1]
            j++
        }
        i++
    }
    arr.splice(j,arr.length  - j)
    return arr
}

