// ?? Merging Two Sorted Array 

function MergeTwoSortedArray(arr1=[],arr2=[]) {
    let i = j = k =0;
    let arr = new Array(arr1.length + arr2.length)
    while(i < arr1.length  && j < arr2.length ){
        if(arr1[i] < arr2[j]){
            arr[k++] = arr1[i++]
        } else {
            arr[k++] = arr2[j++]
        }
    }
    while(i < arr1.length ) {
        arr[k++] = arr1[i++]
    }
    while(j < arr2.length ) {
        arr[k++] = arr2[j++]
    }
    return arr
}

