// ?? Best Time To Buy And Sell Stock

const Prices = [7,2,2,5,11,2,9,1]
// Index's are the day 

var maxProfit = function(prices) {
    let MaxProfit = 0;
    let Min = prices[0]
    for(let i = 0; i < prices.length; i++) {
        let Item = prices[i]
        let Profit = Item - Min
        if(Item < Min){
            Min = Item
        } else if( Profit > MaxProfit ){ 
            MaxProfit = Profit
        }
    }
    return MaxProfit
};

